        anime({
            targets: '#kate',
            translateX: 750,
            scale: 3,
            duration: 500
        });
        anime({
            targets: '.about',
            translateX: -400,
            scale: 3,
            'visibility': 'visible',
            delay:300,
            duration: 500
        });
        return (
            <main>
                <img src="./img/IMG_0070.jpg" id="kate"/>
                <div className="about">
                    Hi! I am Kate. I am Software Engineer at Huawei.
                </div>
            </main>
        );
    }
};

export default Profile;
